const products = [
    { id: 1, name: "Trousers", price: 18000, img: "data:image/webp;base64," },
    { id: 2, name: "Skirt", price: 25000, img: "data:image/webp;base64," },
    { id: 3, name: "Gown", price: 15000, img: "data:image/jpeg;base64," },
    { id: 4, name: "Material", price: 10000, img: "data:image/jpeg;base64," },
    { id: 5, name: "Shirt", price: 250000, img: "https://th.bing.com/th/id/OIP.k5cB6TWW4XimJy7CEsrauAHaKj?w=129&h=185&c=7&r=0&o=7&cb=ucfimg2&pid=1.7&rm=3&ucfimg=1https://th.bing.com/th/id/OIP.k5cB6TWW4XimJy7CEsrauAHaKj?w=129&h=185&c=7&r=0&o=7&cb=ucfimg2&pid=1.7&rm=3&ucfimg=1" },
    { id: 6, name: "Thread", price: 150000, img: "data:image/jpeg;base64," }

];

const productsContainer = document.getElementById("products");

function displayProducts(list) {
    productsContainer.innerHTML = "";
    list.forEach(p => {
        productsContainer.innerHTML += `
            <div class="product-card">
                <img src="${p.img}" alt="${p.name}">
                <h3>${p.name}</h3>
                <p>₦${p.price}</p>
                <button onclick="addToCart(${p.id})">Add to Cart</button>
            </div>
        `;
    });
}
displayProducts(products);

let cart = [];

function addToCart(id) {
    const product = products.find(p => p.id === id);

    const existingItem = cart.find(item => item.id === id);

    if (existingItem) {
        existingItem.quantity++;
    } else {
        cart.push({
            id: product.id,
            name: product.name,
            price: product.price,
            img: product.img,
            quantity: 1
        });
    }

    localStorage.setItem("cart", JSON.stringify(cart));
    updateCartCount();
}

function updateCartCount() {
    const count = cart.reduce((sum, item) => sum + item.quantity, 0);
    document.getElementById("cart-count").textContent = count;
}

const cartModal = document.getElementById("cart-modal");
const cartBtn = document.getElementById("cart-btn");
const closeCart = document.getElementById("close-cart");

cartBtn.onclick = () => {
    cartModal.style.display = "flex";
    updateCartUI();
};

closeCart.onclick = () => {
    cartModal.style.display = "none";
};

function updateCartUI() {
    const cartItems = document.getElementById("cart-items");
    const cartTotal = document.getElementById("cart-total");

    cartItems.innerHTML = "";
    let total = 0;

    cart.forEach((item, index) => {
        total += item.price * item.quantity;

        cartItems.innerHTML += `
            <li class="cart-item">
                <img src="${item.img}" class="cart-img">

                <div class="cart-info">
                    <p>${item.name}</p>
                    <p>₦${item.price}</p>

                    <div class="qty-controls">
                        <button onclick="decreaseQty(${index})">−</button>
                        <span>${item.quantity}</span>
                        <button onclick="increaseQty(${index})">+</button>
                    </div>
                </div>

                <button class="remove-btn" onclick="removeItem(${index})">❌</button>
            </li>
        `;
    });

    cartTotal.textContent = total;
    localStorage.setItem("cart", JSON.stringify(cart));
}

function increaseQty(index) {
    cart[index].quantity++;
    updateCartUI();
}

function decreaseQty(index) {
    if (cart[index].quantity > 1) {
        cart[index].quantity--;
    } else {
        cart.splice(index, 1);
    }
    updateCartUI();
}

//function removeItem(index) {
//    cart.splice(index, 1);
 //   updateCartUI();
 //   updateCartCount();
//}


function removeItem(index) {
    cart.splice(index, 1);
    updateCartCount();
    updateCartUI();
}

document.getElementById("search").addEventListener("input", (e) => {
    const text = e.target.value.toLowerCase();
    const filtered = products.filter(p => p.name.toLowerCase().includes(text));
    displayProducts(filtered);
});

const checkoutBtn = document.getElementById("checkout-btn");

checkoutBtn.addEventListener("click", () => {
    if (cart.length === 0) {
        alert("Your cart is empty!");
        return;
    }

    // Save cart before going to checkout
    localStorage.setItem("cart", JSON.stringify(cart));

    // Go to checkout page
    window.location.href = "checkout.html";
});
